Information
------------------------------

The Woman With No Face
Following the story of beauty queen and young mum Tambudzai Makinzi - Tambu to friends and family - as she undergoes a pioneering operation here in the UK to remove a giant 2kg tumour which has destroyed her face, taken her eyesight and robbed her of her sense of smell.
In a desperate attempt to save her life, Tambu travelled 6000 miles from her home in Cape Town to London to meet an extraordinary surgeon: Professor Iain Hutchinson. The Professor is known throughout the world for taking on cases nobody else will tackle and set up the research charity Saving Faces, funding pioneering development into facial trauma and disease, and he agreed to take on the operation free of charge.

